    DECLARE DIST FLOAT;
    DECLARE MILES FLOAT;
   
    SET THETA = LON1 - LON2;
    SET DIST = SIN(RADIANS(LAT1)) * SIN(RADIANS(LAT2)) + COS(RADIANS(LAT1)) * COS(RADIANS(LAT2)) * COS(RADIANS(THETA));
    SET DIST = ACOS(DIST);
    SET DIST = DEGREES(DIST);
    SET MILES = DIST * 60 * 1.1515;
    SET MILES = MILES * 1609.344;
   
    RETURN MILES;

    END$$

